css:
@-moz-document domain("bbnradio.org") {
.container,
.main_color,
.container_wrap {
    background: #333333;
}

#top #header_meta,
#top #header_meta nav ul ul li,
#top #header_meta nav ul ul a,
#top #header_meta nav ul ul {
    background: #333333;
}

#top #header .av-main-nav > li > a {
    color: #FFFFFF;
    background: none;
}

#top .av_iconlist_title a {
    color: #FFFFFF;
}

.iconlist_content p {
    color: #888787;
}

.logo img {
    object-position: -99999px 99999px;
    background-image: url(data:image/jpg;base64,);
}
}
